import React from 'react';


class Images extends React.Component {
    render() {
        return (
            <div>
                <img alt="map2" src="https://www.google.com/url?sa=j&url=https%3A%2F%2Fwww.shutterstock.com%2Fsearch%2Fgood&uct=1568201157&usg=ZV4yvbkgFsdEtKXnfxIGj5FxHUM.&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNjEhKHX3OUCFQAAAAAdAAAAABAD" sizes="(min-width: 600px) 200px, 50vw"></img>
            </div>
        );
    }
}

export default Images;
